import React, { Component } from 'react';
import { Client } from 'ssh2';
import { FunctionComponent, useEffect } from "react";


const connectToSSHServer: FunctionComponent = () => {
    const conn = new Client();

    conn.on('ready', () => {
        console.log('Connected to SSH server');
        // Do something with the connection here
    });

    conn.on('error', (err) => {
        console.log(`Error connecting to SSH server: ${err.message}`);
    });

    conn.connect({
        host: '100.121.193.21',
        port: 22, // replace with the actual port number, if necessary
        username: 'administrator',
        password: 'clearpath'
    });
    return (
        <div>
        </div>
    );
}






export default connectToSSHServer;
